/*
 * @Author: your name
 * @Date: 2021-11-02 14:29:58
 * @LastEditTime: 2022-03-22 10:03:10
 * @LastEditors: Please set LastEditors
 * @Description: 打开koroFileHeader查看配置 进行设置: https://github.com/OBKoro1/koro1FileHeader/wiki/%E9%85%8D%E7%BD%AE
 * @FilePath: \bl-device-manage\src\routes\index.js
 */
/* 
* router by zyn on 0509
* Router -- 根节点
* BrowserHistory 建立路由传递文件 当前路由引入方式
* Switch 路由切换组件 Router 路由包裹  Redirect 路由指向
* HomeLayout 最外层Home包裹架子
*/

import React,{PureComponent} from 'react';
import { 
  BrowserRouter as Router,
  // Redirect,
  Route,
  Switch
} from 'react-router-dom';

/* 引入组件 */
import { 
  HomeRouter,
  LoginPage,StudioPage,StudioDevice,
  ZWordView
} from './home';
import CustomForm from '../layouts/TableEdit/index'

export default class RootRouter extends PureComponent{
  render(){
    return (
      <Router >
        <Switch>
          <Route path='/login' component={CustomForm} />
          <Route path='/iotstudio' component={StudioPage} />
          <Route path='/iot/device' component={StudioDevice} />
          <Route path='/iot/doc' component={ZWordView} />
          <Route path='/' component={HomeRouter} />
        </Switch>
      </Router>
    );
  }
}
